// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import HomePage from './pages/HomePage'; // Correct if exported as `export default HomePage`
import PropertyList from './pages/PropertyList'; // Correct if exported as `export default PropertyList`
import ServicePage from './pages/ServicePage'; // Correct if exported as `export default ServicePage`
import Header from './components/Header'; // Correct if exported as `export default Header`
import Footer from './components/Footer'; // Correct if exported as `export default Footer`

function App() {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/properties" element={<PropertyList />} />
        <Route path="/services" element={<ServicePage />} />
      </Routes>
      <Footer />
    </Router>
  );
}

export default App;
